import { Outlet } from "react-router-dom";

function Layout() {
    return (
        <>
            <header className="w-full flex justify-center py-5 bg-[#333] text-white">
                Header

            </header>
            <div className="flex items-center justify-between w-full py-10">
                <Outlet />
            </div>
            <footer className="w-full flex justify-center py-5 bg-[#333] text-white">
                Footer
            </footer>
        </>
    );
}

export default Layout;
